package com.dilidili.of.entity;public class LiveListBean extends BaseBean {    private Data data;    private long code;    private String message;    public Data getData() {        return this.data;    }    public void setData(Data data) {        this.data = data;    }    public long getCode() {        return this.code;    }    public void setCode(long code) {        this.code = code;    }    public String getMessage() {        return this.message;    }    public void setMessage(String message) {        this.message = message;    }    public String toString() {        return "ExampleBean [data = " + data + ", code = " + code + ", message = " + message + "]";    }    public class Data extends BaseBean {        private Recommend_data recommend_data;        public Recommend_data getRecommend_data() {            return this.recommend_data;        }        public void setRecommend_data(Recommend_data recommend_data) {            this.recommend_data = recommend_data;        }        public String toString() {            return "Data [recommend_data = " + recommend_data + "]";        }    }}